import React, { Component } from 'react';
import styled from 'styled-components'
import { Container, Row, Col } from 'reactstrap';

const Head = styled.h1`
  margin-bottom: 3%;
  margin-top: 10%;
  font-size: 55px;
  font-weight: bold;
  line-height: 1.35;
  color: #69302c;
`

const Sub = styled.p`
  font-size: 24px;
  font-weight: 500;
  color: #69302c;
`
const SubText = styled.div`
  font-size: 21px;
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  &:hover {
    color: #69302c;
    text-decoration: none;
  }
`
const Button = styled.button`
    cursor: pointer;
    background-color:#69302c;
    border:0px solid transparent;
    border-radius: 3px;
    color: #fff;
    padding: 0.4em 1.25em;
    font-size: 21px;
    width: auto;
    margin: 0px;
    &:hover {
    color: #69302c;
    text-decoration: none;
  }
`
const Hover = styled.a`
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  text-decoration: none;
  &:hover {
    color: #69302c;

  }
`
const Img =styled.img`
  transform: matrix(1, 0, 0, 1, 0, 0);
  width: 100%;
  height: auto;
`
class App extends Component {
    render() {
        return (

          <Img src="static/img/home1.jpg" alt="" class="c-intro_image || js-intro-image"></Img>
                    );
                  }
                }
export default App
